import React, { Component } from 'react'
import { connect } from 'react-redux';
import * as actions from '../redux/actions';

const sprites = [{
  name: 'guitar', url:'https://image.flaticon.com/icons/png/128/26/26843.png'
}]

class SpriteBar extends Component{

  sprites = () => {
    debugger
    return sprites.map(sprite => <img src={sprite.url}/>)
  }

  render(){
    const divStyle = {position: 'absolute',
      width: '150px',
      height: '100vh',
      left: '0',
      top: '10',
      backgroundColor: '#EEEEEE',
      borderRight: '1px dotted'}

    return(
      <div style={divStyle} className="wip" onDragOver={(e)=>this.onDragOver(e)}
        onDrop={(e)=>{this.onDrop(e, "wip")}}>
        <h1>Sprite Bar</h1>
        {this.sprites()}
      </div>
    )
  }
}

function mapStateToProps(state) {
  return {
    // animalSrc: state.animal.animalSrc,
    // isLoading: state.animal.isLoading,
  }
}

export default connect(mapStateToProps, actions)(SpriteBar);
